// SPDX-License-Identifier: UNLICENSED

pragma solidity 0.8.4;

import "../../lib/token/ERC721/ERC721.sol";
import "../../lib/access/Ownable.sol";
import "../../lib/security/Pausable.sol";
import "../../lib/token/ERC721/extensions/ERC721Pausable.sol";

contract TaureumERC721 is ERC721Pausable, Ownable {
    /**
     * @dev Mapping from NFT ID to metadata uri.
     */
    mapping(uint256 => string) internal idToUri;

    /**
     * @dev The base URI for all NFT.
     */
    string private __baseURI;

    /**
     * @dev Create a new TaureumERC721 contract.
     *
     */
    constructor() ERC721("Taureum ERC721", "Taureum") Ownable() Pausable() {
        __baseURI = "";
    }

    /**
     * @dev Pause the contract in case of bugs/attacks.
     * @notice Only the owner can call this method.
     */
    function pause() public onlyOwner {
        _pause();
    }

    /**
     * @dev Resume the contract after being paused.
     * @notice Only the owner can call this method.
     */
    function unPause() public onlyOwner {
        _unpause();
    }

    /**
      * @dev Safely mint a new NFT.
      * @notice It throws an exception if
      *    - `to` is a "ZERO_ADDRESS.
      *    - If `to` refers to a smart contract, it must implement {IERC721Receiver-onERC721Received}, which is called upon a safe transfer.
      * @param to The address that will own the minted NFT.
      * @param uri The URI consists of metadata description of the minting NFT on the IPFS (without prefix).
      */
    function safeMint(
        address to,
        string calldata uri
    )
    public
    returns (uint256)
    {
        uint256 id = uint256(keccak256(abi.encode(to, uri)));

        _safeMint(to, id);
        _setTokenUri(id, uri);

        return id;
    }

    /**
      * @dev Mint a new NFT.
      * @notice It throws an exception if
      *    - `to` is a "ZERO_ADDRESS.
      * @param to The address that will own the minted NFT.
      * @param uri The URI consists of metadata description of the minting NFT on the IPFS (without prefix).
      */
    function mint(
        address to,
        string calldata uri
    )
    public
    returns (uint256)
    {
        uint256 id = uint256(keccak256(abi.encode(to, uri)));

        _mint(to, id);
        _setTokenUri(id, uri);

        return id;
    }

    /**
     * @dev See {IERC721Metadata-tokenURI}.
     */
    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");

        return bytes(__baseURI).length > 0 ? string(abi.encodePacked(__baseURI, idToUri[tokenId])) : idToUri[tokenId];
    }

    /**
     * @dev Sets new value for the `__baseURI`. This operation can only been done by the owner of this contract.
     */
    function setBaseURI(string memory newBaseURI) external onlyOwner whenNotPaused {
        __baseURI = newBaseURI;
    }

    /**
     * @dev Returns `__baseURI`.
     */
    function baseURI() external view returns(string memory) {
        return __baseURI;
    }

    /**
